import 'package:equatable/equatable.dart';import 'package:intex_mobile_app/core/models/Catalog.dart';class Catalogs extends Equatable {  const Catalogs({required this.itemNames});  final List<Catalog> itemNames;  List<Catalog> getById(int id)=> itemNames.where((element) =>  element.category_id == id).toList();  List<Catalog> getByPosition(int position) => getById(position);  @override  List<Object> get props => [itemNames];}